import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'
import Link from 'next/link'
import styles from '../styles/index.module.scss'
import { getSortedPostsData } from '../lib/posts'

export async function getStaticProps() {
  const allPostsData = getSortedPostsData()
  return {
    props: {
      allPostsData
    }
  }
}

export default function Home({ allPostsData }) {
  return (
    <Layout>
      <Head>
        <title>{siteTitle}</title>
      </Head>
      <section>
        <ul className={styles.mainWrapper}>
          {allPostsData.map(({ id, date, title }) => (
            <li className="
              mx-auto my-4 w-autp bg-white shadow h-64 flex items-center justify-center
              md:w-1/2">
              <Link href="/posts/[id]" as={`/posts/${id}`}>
                <a>
                  <p className="w-full m-2">{title}</p>
                  <p className="w-full m-2">{date}</p>
                </a>
              </Link>
            </li>
          ))}
          {allPostsData.map(({ id, date, title }) => (
              <li className={styles.empty}></li>
          ))}
        </ul>
        <div className={styles.bannerWrapper}>
          <a className={styles.banner} href="https://machicon.jp/" target="_blank">
            <img title="machicon JAPAN" src="https://machicon.jp/mj_logo400-91.png" alt="全国街コン公式サイト machicon JAPAN"/>
          </a>
        </div>
      </section>
    </Layout>
  )
}
